import React from "react";

function DriveVideoEmbed({ videoUrl, width, height}) {
    return (
        <div>
            <iframe
                src={videoUrl}
                style={{

                    top: 0,
                    left: 0,
                    width: width,
                    height: height,
                    border: "none",
                }}
                allow="autoplay"
                title="Google Drive Video"
            ></iframe>
        </div>
    );
}

export default DriveVideoEmbed;
